> Top News Pat Murphy out as interim manager of losing Padres FILE - In this June 16, 2015, file photo, San Diego Padres interim manager Pat Murphy looks on before a baseball game against the Oakland Athletics in San Diego. A.J. Preller, Padres executive vice president/general manager, announced Sunday, Oct. 4, 2015, that the club will begin a search for a new manager immediately. Murphy will not be returning in the same capacity with the team in 2016. (AP Photo/Gregory Bull, File) 
